"use strict";(self.webpackChunkstatic_site=self.webpackChunkstatic_site||[]).push([[618],{618:e=>{e.exports=JSON.parse('[{"id":"0066902c-dfbc-4094-82d7-817c1e4533e0","slug":"san-mateo-county-pride-center","externalUrl":"https://sanmateopride.org/","tags":["transmasculine","non-binary","transfeminine","healthcare","mental-health","social-services"],"address":"1021 S El Camino Real, San Mateo, CA 94402, USA","phoneNumber":"650-591-0133","country":"US","provinceOrState":"CA","city":"San Mateo","county":"San Mateo County","latLng":[37.5569591,-122.3189073],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/san-mateo-county-pride-center-san-mateo","googleMapsUrl":"https://goo.gl/maps/uj5ogP9y4LboxZYD9","facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"مركز سان ماتيو كاونتي للفخر","description":"مركز سان ماتيو كاونتي للفخر هو منظمة نموذج تعاون ومحطة واحدة لخدمة المجتمع المثلي. نحن نقدم برامج وخدمات قوية لدعم أعضاء المجتمع المثلي من جميع الأعمار، بما في ذلك التعليم، التدريب، الأحداث المجتمعية، مجموعات الدعم النظير، برمجة يومية، العلاج السريري، والإدارة الحالة."},{"id":"0db36ba9-b329-4a54-8302-d7810866457a","slug":"diyhrtcafe","externalUrl":"https://diyhrt.cafe","tags":["transfeminine","non-binary","transmasculine","healthcare","education-awareness"],"title":"DIYHRT.cafe","description":"مجتمع اونلاين نابض بالحياة ومركز معرفة للأشخاص المهتمين بالعلاج الهرموني البديل (HRT). موقعهم على الويب مُ dedicated to providing a safe and inclusive space where people can access information, resources, and support for self-administered HRT. سواء كنت تستكشف الأساليب البديلة، أو تبحث عن التوجيه حول الجرعة والإدارة، أو ببساطة تبحث عن التواصل مع الآخرين الذين يشاركون تجارب مماثلة، يقدم DiyHRT.cafe ثروة من الإطلاعات القيمة, قصص شخصية, ونصائح خبير لمساعدتك في اتخاذ قرارات مستنيره بشأن صحتك ورفاهيتك."},{"id":"18ba5d3d-c47d-47f8-90a4-2f353a1f13ce","slug":"ftmguideorg","externalUrl":"https://FTMGuide.org","tags":["non-binary","transmasculine","healthcare","clothing"],"title":"FTMGuide.org","description":"منصة إلكترونية شاملة م dedicateded إلى دعم الأفراد الذين ينتقلون من الإناث إلى الذكور (FTM). يعمل موقعهم على الإنترنت كمورد موثوق، ويوفر الكثير من المعلومات، والإرشاد، وروابط المجتمع لأولئك الذين يبدأون رحلتهم FTM. من النصائح العملية حول العلاج بالهرمونات والخيارات الجراحية إلى دعم الصحة العقلية والقصص الشخصية، يهدف FTMGuide.org إلى تمكين الأفراد بالمعرفة والموارد التي يحتاجونها للتنقل في تحولهم بثقة ووضوح."},{"id":"1e8cb769-f49b-4428-86ea-2c4cbec96905","slug":"transfemscienceorg","externalUrl":"https://transfemscience.org","tags":["transfeminine","non-binary","healthcare"],"title":"transfemscience.org","description":"منصة عبر الإنترنت رائدة تُكرس لتقديم البحوث والتعليم والموارد المستندة إلى الأدلة للمجتمع المتحول وغير الثنائي، مع التركيز بشكلٍ خاص على العلاج بالهرمونات المؤنثة (FHT). تعمل موقعهم على الإنترنت كمركز حيوي للأفراد الذين يبحثون عن معلومات ثابتة ومُحدثة عن الجوانب الطبية والفيزيولوجية والنفسية لـ FHT. من خلال مجموعتهم الشاملة من الدراسات التي تمت مراجعتها من قبل الأقران، ومقالات الخبراء، والدلائل العملية، يُمكِّن موقعهم الأفراد من اتخاذ قرارات مستنيرة بشأن عملية التحول والصحة."},{"id":"3b5a33bd-aba4-4205-9a86-293b172e38ee","slug":"genderdysphoriafyi","externalUrl":"https://genderdysphoria.fyi","tags":["transmasculine","non-binary","transfeminine","mental-health","support-groups","community-stories","education-awareness"],"title":"genderdysphoria.fyi","description":"مورد موثوق على الإنترنت للأفراد الذين يبحثون عن المعرفة، والدعم، والتفهم حول اضطراب الهوية الجنسية. يوفر موقعهم الإلكتروني ثروة من المعلومات والموارد وروابط المجتمع لتمكين الأفراد في رحلتهم. من الدلائل الشاملة حول الهوية الجنسية والانتقال إلى القصص الشخصية والنصائح الخبيرة، يسعون إلى خلق مساحة آمنة وشاملة للجميع."},{"id":"4332f79d-1323-45ca-9b40-df63af9b7179","slug":"movement-advancement-project","externalUrl":"https://www.lgbtmap.org/","tags":["legal","healthcare","education-awareness"],"address":"1905 15th St #1097, Boulder, CO 80302, USA","email":null,"phoneNumber":"(303) 578-4600","country":"US","provinceOrState":"CO","city":"Boulder","county":"Boulder County","latLng":[40.0178641,-105.2763041],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/lgbtmap/","twitterUrl":"https://twitter.com/lgbtmap","instagramUrl":"https://www.instagram.com/lgbtmap/","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"مشروع التقدم في الحركة","description":"مشروع التقدم في الحركة (MAP) هو مركز أبحاث مستقل وغير ربحي يقدم البحث الدقيق والرؤى والاتصالات التي تساعد في تسريع المساواة والفرص للجميع. يعمل MAP على ضمان أن لجميع الأشخاص فرصة عادلة في متابعة الصحة والسعادة، كسب المعيشة، العناية بمن يحبون، والشعور بالأمان في مجتمعاتهم، والمشاركة في الحياة المدنية."},{"id":"43609b17-7528-4c60-94b4-e90866144715","slug":"jordan-ross-communication-services","externalUrl":"https://www.jordanrosscommunication.com/","tags":["voice-training"],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":"https://www.instagram.com/jordanrosscommunication/","youtubeUrl":"https://www.youtube.com/channel/UC4o7h219hPYdBcPaFpgh9Yw","tiktokUrl":"https://www.tiktok.com/@jordanrosscommunication","twitchUrl":null,"patreonUrl":null},"title":"خدمات الاتصالات الأردن روس","description":"يقدم الأردن روس تدريبًا على الكلام والصوت والاتصال للأفراد المتحولين جنسيًا، والكوير والذين لا يتوافقون مع الجنس. يقدم تدريبًا فرديًا، ودورات عبر الإنترنت، والأحداث، و \'برنامج التدريب الصوتي من الداخل\'. يتضمن مقاربته البرمجة العصبية اللغوية، والتنويم المغناطيسي، وتعليمات اليوجا، وتدريب التنفس، بهدف معالجة ليس فقط الجوانب الجسدية ولكن أيضًا العقلية والعاطفية والطاقية من الاتصال."},{"id":"47b17f76-670a-4835-8773-409d98934b91","slug":"sylvia-rivera-law-project","externalUrl":"https://srlp.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"address":"147 W 24th St #5th, New York, NY 10011, USA","phoneNumber":"212-337-8550","country":"US","provinceOrState":"NY","city":"New York","town":"Manhattan","county":"New York County","latLng":[40.744576,-73.9941166],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/sylvia-rivera-law-project-new-york?osq=sylvia+rivera+law+project","googleMapsUrl":"https://goo.gl/maps/sjGv8qoSZPe3XE2QA","facebookUrl":"https://www.facebook.com/sylviariveralawproject","twitterUrl":"https://www.twitter.com/srlp","instagramUrl":"https://instagram.com/sylviariveralawproject/","youtubeUrl":"https://www.youtube.com/user/SylviaRiveraLP","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"مشروع سيلفيا ريفيرا للقانون (SRLP)","description":"يعمل مشروع سيلفيا ريفيرا للقانون على ضمان حق الجميع في تقرير هوية الجندر والتعبير عنها بحرية، بغض النظر عن الدخل أو العرق، ودون التعرض للتحرش أو التمييز أو العنف. يقدم SRLP المساعدة القانونية، وينظم الحملات، ويجري التدريبات، ويدير لجنة الاستشارية للسجناء. يتم تشجيع مشاركة المجتمع من خلال التبرعات، والتطوع، والعضوية."},{"id":"499aa5dd-d3c0-42f6-a686-853672f3c71e","slug":"erin-in-the-morning","externalUrl":"https://www.erininthemorning.com/","tags":["transfeminine","legal","healthcare","education-awareness"],"email":"null","socialMedia":{"facebook":"facebook.com/erininthemorning","email":"mailto:info@erininthemorning.com"},"title":"إيرين في الصباح","description":"أخبار ومناقشات حول التشريعات الخاصة بالمتحولين جنسياً والحياة. بواسطة إيرين ريد · أكثر من 38,000 مشترك"},{"id":"4be75e80-8ce1-4f46-90f0-ad307cd1829b","slug":"equaldexcom","externalUrl":"https://EqualDex.com","tags":["transfeminine","non-binary","transmasculine","partner-resources"],"title":"EqualDex.com","description":"منصة عبر الإنترنت مبتكرة تهدف إلى إنشاء مورد شامل ومحدث لحقوق LGBTQ+ العالمية. يوفر موقعهم قاعدة بيانات مركزية للقوانين والسياسات والمواقف المجتمعية تجاه حقوق LGBTQ+ في جميع أنحاء العالم. من خلال رسم البيانات وتصويرها بشكل بصري على الإنصاف والشمولية والحماية القانونية، يقدم EqualDex.com أداة قوية للنشطاء والباحثين والأفراد الذين يسعون لفهم والدعوة إلى حقوق LGBTQ+ على نطاق عالمي. استكشف خرائطهم التفاعلية، وتصفح الملفات الشخصية الخاصة بالبلد، وابق على اطلاع على أحدث التطورات والتحديات التي تواجه مجتمع LGBTQ+ في جميع أنحاء العالم."},{"id":"58738396-e4d7-424a-ba8d-59559e883f06","slug":"strandsfortransorg","externalUrl":"https://strandsfortrans.org","tags":["transfeminine","non-binary","transmasculine","friendly-businesses","makeup"],"title":"strandsfortrans.org","description":"Strands For Trans هو شبكة عالمية من صناعة الشعر والجمال والصحة والمنظمات التي تسعى لخلق وإلهام تجارب إيجابية وآمنة لجميع الضيوف، خاصة الضيوف من المجتمع الترانس."},{"id":"594ba858-974c-4c09-8fd4-f4bb35ca6c5f","slug":"pacific-center-for-human-growth","externalUrl":"https://www.pacificcenter.org/","tags":["mental-health","support-groups","healthcare","youth-services","education-awareness"],"address":"2712 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"510-548-8283","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8611143,-122.2593404],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/pacific-center-berkeley","googleMapsUrl":"https://goo.gl/maps/dSnoipA7TWiDN72b7","facebookUrl":"https://www.facebook.com/pacific.center","twitterUrl":null,"instagramUrl":"https://www.instagram.com/pacificcenterberkeley/","youtubeUrl":"https://www.youtube.com/user/TheInQueery","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"مركز المحيط الهادئ للنمو البشري","description":"تأسس في عام 1973، مركز المحيط الهادئ للنمو البشري هو أقدم مركز لـ LGBTQIA+ في منطقة خليج سان فرانسيسكو، والثالث الأقدم في البلاد، ويدير العيادة النفسية الوحيدة التي تتبع نظام السعر المنزلق لـ LGBTQIA+ و QTBIPOC وعائلاتهم في مقاطعة ألاميدا."},{"id":"682fba48-f668-4fe6-89a7-05a90193e778","slug":"oakland-lgbtq-community-center","externalUrl":"https://www.oaklandlgbtqcenter.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","education-awareness","financial-aid-scholarships","community-stories","partner-resources"],"address":"3207 Lakeshore Ave, Oakland, CA 94610, USA","phoneNumber":"510-882-2286","country":"US","provinceOrState":"CA","city":"Oakland","county":"Alameda County","latLng":[37.8103802,-122.2459822],"socialMedia":{"yelpUrl":null,"googleMapsUrl":"https://goo.gl/maps/EnhwARKBin25SAmA6","facebookUrl":"https://www.facebook.com/oaklandlgbtqcommunitycenter/?notify_field=blurb&modal=profile_completion&notif_t=page_profile_blurb&notif_id=1499829595947085","twitterUrl":null,"instagramUrl":"https://www.instagram.com/oaklandlgbtqcenter","youtubeUrl":"https://youtu.be/3qxj1a9esuU","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"مركز مجتمع لوس أنجلوس للمثليين والمثليات ومزدوجي الجنس","description":"أول مركز خدمة مجتمعية غير ربحي يعود تأسيسه لـ501c3 في لوس أنجلوس، يقبل جميع الأعمار ومن جميع الأطياف، والذي يشمل مجتمع المثليين والمثليات ومزدوجي الجنس. الخدمات المقدمة تشمل مجموعات الدعم، الدعم النفسي، المساعدة السكنية، برنامج الشباب، العيادة القانونية، مستودع الطعام، إلخ. كما يتم إجراء برامج خاصة أيضًا للمثليين والمثليات المسنين وأفراد مجتمع المتحولين جنسيا."},{"id":"7fb1e1a6-bd81-4515-9aaa-70aea4580e55","slug":"gender-diversity","externalUrl":"https://genderdiversity.org","tags":["education-awareness","healthcare","youth-services","support-groups","parent-family-resources","social-services","non-binary","transmasculine","transfeminine"],"address":"6523 California Ave SW #144, Seattle, WA 98136","country":"US","provinceOrState":"WA","city":"Seattle","county":"King County","latLng":[47.544046,-122.387452],"phoneNumber":"1-833-3GENDER","email":"info@genderdiversity.org","title":"التنوع الجنسي","description":"يعمل التنوع الجنسي على تحسين رفاهية الأطفال والبالغين من كافة الهويات والتعبيرات الجنسية من خلال توفير التعليم وزيادة الوعي وتقديم الرؤية حول النطاق الأوسع من التجربة البشرية. كما نقوم بالمساعدة في خلق بيئات داعمة وغير تمييزية في المدارس والفرق الرياضية وأماكن العمل ومقدمي الرعاية الصحية للأفراد من المتحولين جنسيا والذين يتمتعون بتنوع جنسي."},{"id":"878e809b-12aa-483f-be01-3c51a4d331d6","slug":"national-center-for-transgender-equality","externalUrl":"https://transequality.org","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","education-awareness","financial-aid-scholarships"],"address":"1032 15th St NW #199, Washington, DC 20005, USA","phoneNumber":"(202) 642-4542","country":"US","provinceOrState":"CA","city":"Washington D.C.","county":"District of Columbia","latLng":[38.903438,-77.035037],"email":"ncte@transequality.org","socialMedia":{"blogUrl":"https://transequality.org/blog"},"title":"المركز الوطني للمساواة بين المتحولين جنسيا","description":"المركز الوطني للمساواة بين المتحولين جنسيا هو منظمة تدعو لتغيير السياسات والمواقف المجتمعية لزيادة الفهم والقبول للأشخاص المتحولين جنسيا. يوفر NCTE معلومات حول القضايا التي تؤثر على المجتمع المتحول جنسيًا بما في ذلك الشيخوخة، مكافحة العنف، التوظيف، الأسر، الصحة و الإيدز، الإسكان والبطالة، وأكثر."},{"id":"8ab7bb47-206d-4872-a3ca-e692ce2036ec","slug":"florida-name-change-home","externalUrl":"https://www.floridanamechange.org/","tags":["legal","social-services"],"address":null,"phoneNumber":null,"country":"US","provinceOrState":"FL","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"الصفحة الرئيسية لتغيير الاسم في فلوريدا","description":"تُقدم هذه الموقع إرشادًا خطوة بخطوة للأشخاص الذين يرغبون في تحديث اسمهم أو جنسهم في فلوريدا. تشمل الخطوات تقديم عريضة في المحكمة، وتحديث بطاقة الضمان الاجتماعي، ورخصة القيادة، والجواز، وشهادة الميلاد."},{"id":"a453684e-c325-457f-8841-05c0adabbbc0","slug":"the-trevor-project","externalUrl":"https://www.thetrevorproject.org/","tags":["youth-services","support-groups","mental-health","education-awareness"],"address":"West Hollywood, CA 90069, USA","email":null,"phoneNumber":"(212) 695-8650","country":"US","provinceOrState":"CA","city":"West Hollywood","county":"Los Angeles County","latLng":[34.0931603,-118.3783347],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/TheTrevorProject","twitterUrl":"https://twitter.com/trevorproject","instagramUrl":"https://www.instagram.com/trevorproject/","youtubeUrl":"https://www.youtube.com/thetrevorproject","tiktokUrl":"https://www.tiktok.com/@trevorproject","twitchUrl":null,"patreonUrl":null},"title":"مشروع تريفور","description":"مشروع تريفور هو منظمة غير ربحية أمريكية تقدم خدمات الوقاية من الانتحار للشباب LGBTQ+. يقدم الموقع موارد قيمة للمجتمع المتحول جنسيًا، بما في ذلك تدخل الأزمات وخط الوقاية من الانتحار، وتريفور تشات، وتريفور تكست وكذلك الإرشاد حول الصحة العقلية، والخدمات الاجتماعية، وجماعات الدعم."},{"id":"ab058b91-49cf-4733-b3a3-47ea59b31a78","slug":"a-place-for-marsha","externalUrl":"https://www.aplaceformarshaofficial.org/","tags":["transmasculine","non-binary","transfeminine","legal","mental-health","social-services","support-groups","education-awareness","financial-aid-scholarships","community-stories"],"email":"info@aplaceformarshaofficial.org","socialMedia":{"tiktok":"https://www.tiktok.com/@aplaceformarsha"},"title":"مكان لمارشا","description":"مكان لمارشا هو واحد من العديد من مشاريع الشركات الناشئة التي تهدف إلى مساعدة الأفراد المتحولين جنسيا وعائلاتهم في الولايات المتزايدة الخطورة إلى مكان أكثر أمانا. بدأت APFM رحلتها في مارس من العام 2023 رداً على ارتفاع التشريعات المعادية للتحول الجنسي في جميع أنحاء الوطن. تُركز APFM الآن على مطابقة اللاجئين من الولايات الحمراء كرفاق في الغرفة، معالجة بعناية منزل واحد في كل مرة."},{"id":"b6955ff7-83b4-464f-8be8-72a50dc6a878","slug":"transvoicelessons","externalUrl":"https://www.transvoicelessons.com/","tags":["voice-training"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":"https://www.youtube.com/c/transvoicelessons","tiktokUrl":null,"twitchUrl":null,"patreonUrl":"https://www.patreon.com/transvoicelessons/posts"},"title":"TransVoiceLessons","description":"توفر TransVoiceLessons خدمات السيطرة على الصوت والتحرر ذات الجودة للأفراد المتحولين جنسياً وغير الثنائيين الذين يهدفون إلى البدو بصوت أكثر رجولة أو أنوثة أو عدم تحديد الجنس."},{"id":"cd48f2d0-8241-4fa5-a0aa-dc3cd3d386e8","slug":"rainbowrailroadorg","externalUrl":"https://RainbowRailroad.org","tags":["transfeminine","non-binary","transmasculine","legal","social-services"],"title":"RainbowRailroad.org","description":"منصة عبر الإنترنت حيوية مكرسة لمساعدة والدفاع عن الأفراد من فئة LGBTQ+ الذين يواجهون الاضطهاد والعنف في جميع أنحاء العالم. من خلال التزام لا يتزعزع، يربط الموقع الأشخاص المهددين بالخطر المباشر بالموارد الحياتية، والمساعدة الطارئة ، والطرق الآمنة للأمان. من خلال الشراكات مع المؤسسات المحلية وشبكة من الداعمين الرحماء، يعمل RainbowRailroad.org دون كلل لتوفير الدعوة، والمساعدة القانونية، ودعم النقل، مما يتيح للأفراد الهروب من الاضطهاد وإيجاد ملاذ. من خلال الدفاع عن حقوق الإنسان، وإنقاذ الأرواح، وتعزيز عالم أكثر شمولا، يعمل RainbowRailroad.org كموقع للأمل والحماية للأفراد من فئة LGBTQ+ الذين يبحثون عن الأمان والحرية."},{"id":"d59c0a9f-14ff-4c55-94d6-82313925be14","slug":"the-mckenzie-project","externalUrl":"https://www.themckenzieproject.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","education-awareness"],"address":"8390 W Flagler St STE 201, Miami, FL 33144, USA","email":"Info@TheMcKenzieProject.org","phoneNumber":"305-846-3186","country":"US","provinceOrState":"FL","city":"Miami","county":"Miami-Dade County","latLng":[25.769445,-80.3321284],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"مشروع ماكنزي","description":"مورد شامل يقدم خدمات وبرامج وأحداث تهدف إلى تعزيز العدالة الجنسانية وخدمة المجتمع المتحول جنسيا. يتضمن خدمات الدعم والموارد بما في ذلك الرعاية الصحية والمساعدة القانونية وخدمات الصحة العقلية والمزيد."},{"id":"d7378cc4-7726-4de1-8427-8203cb9b61ad","slug":"east-bay-trans-queer-counseling","externalUrl":"https://www.eastbaytranscounseling.org/","tags":["transmasculine","non-binary","transfeminine","mental-health","social-services","youth-services","education-awareness"],"email":"eastbaytranscounseling@gmail.com","address":"3099 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"781-775-7802","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8538725,-122.2596505],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"استشارات East Bay Trans وQueer","description":"تقدم استشارات East Bay Trans & Queer خدمات بمقياس متزلج تشمل: العلاج الفردي والذي يقع في موقع مركزي في بيركلي، كاليفورنيا. الدعم من خلال استكشاف الجنس والانتقال، رسائل توصية للهرمونات والجراحة، وتدريبات مهنية لمقدمي الرعاية الصحية النفسية، الطلاب، وأصحاب العمل. سام ديفيس هو عامل اجتماعي سريري مرخص ، محول جنسيا ، وهو مختص في العمل مع المراهقين والبالغين الذين يظهرون كمثلي الجنس، المثليين، المحولين جنسيا، والذين لا يحددون جنسهم. لديهم 16 عامًا من الخبرة كمقدم للرعاية الصحية العقلية في East Bay، بما في ذلك تسهيل دعم مجموعات الأقران، والتعليم المجتمعي في المؤتمرات LGBTQI، و9 سنوات من الممارسة السريرية والاستشارة في الأزمات مع الأشخاص المهمشين بشدة لمقاطعة ألاميدا. إنهم مدافع قوي وملتزم لديه تاريخ طويل في التنظيم نيابة عن الأشخاص المهمشين."},{"id":"eee5057f-7302-4392-b6aa-add70e3e8556","slug":"transgendermap","externalUrl":"https://transgendermap.com","tags":["transfeminine","non-binary","transmasculine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"title":"خريطة المتحولين جنسيا","description":"موقع Transgendermap.com هو مورد عبر الإنترنت يهدف إلى تقديم معلومات عملية وإرشادات للأشخاص الذين يتساءلون حول هويتهم الجندرية أو الموجودين في أي مكان على طيف المتحولين جنسيا. يتضمن الموقع نطاقًا واسعًا من الموضوعات مثل فهم مصطلحات المتحولين جنسيا، عمليات الانتقال، القضايا القانونية، الرعاية الصحية، والعديد من القصص الشخصية. هدفها هو مساعدة الأفراد على التنقل في رحلاتهم الشخصية من خلال تقديم \'خريطة\' أو دليل للعديد من جوانب الهوية الجندرية وتجارب المتحولين جنسيا. يرجى زيارة الموقع الفعلي للحصول على المعلومات الأكثر حداثة ودقة."},{"id":"fc8a7875-84dd-4df5-96ec-8aca153c8ea6","slug":"trans-families-home","externalUrl":"https://transfamilies.org","tags":["transmasculine","non-binary","transfeminine","parent-family-resources","support-groups","education-awareness"],"email":null,"phoneNumber":null,"address":null,"socialMedia":null,"title":"عائلات المتحولين جنسيا","description":"تلهم عائلات المتحولين جنسيا الأمل، وتزيد من التفهم، وتخلق مسارًا واضحًا لدعم الأطفال المتحولين جنسيا والذين يعانون من تنوع الجنس وكل من يلمس حياتهم. نحن نقدم الموارد، وننظم الأحداؤ، ونربط العائلات بجماعات الدعم."}]')}}]);